import Layout from '../components/Layout';
import React from 'react'
import fetch from 'isomorphic-unfetch';

export default function Details (props) {
    return (
        <Layout>
            <h1>Skill Details</h1>
            <select onChange={''}>
                {Object.keys(props.skills.skills).map((key, index) => {
                    return(
                    <option value={this.props.skills.skill_level[key]}>{key}</option>
                    )
                })}
            </select>
            {/* <h2>{props.skills.map(skills => 
                <div>{skills.skill_level}  
                {skills.description}</div>)}</h2> */}
            {/* // {props.skills.skill_level} */}
        </Layout>
    )
}


Details.getInitialProps = async () => {
    let res, data, skills;
    try {
        res = await fetch('http://127.0.0.1:8000/api/v1/skill/')
        data = await res.json();
        skills = data.objects;
    } catch(error){
        console.error(error);
    }
    return {
        skills
    }
};
